import React from 'react';
import { Link } from 'react-router-dom';

function AcademicsPopup() {
  return (
    <div className="academics-popup">
      <div className="popup-section">
        <span className="popup-main-link">Programs</span>
        <Link to="/undergraduate" className="popup-sub-link">Undergraduate</Link>
        <Link to="/postgraduate" className="popup-sub-link">Postgraduate</Link>
      </div>
      <Link to="/academic-calendar" className="popup-main-link">Academic Calendar</Link>
      <Link to="/continuing-education" className="popup-main-link">Directorate of Continuing Education</Link>
      <Link to="/object-based-learning" className="popup-main-link">Object Based Learning</Link>
    </div>
  );
}

export default AcademicsPopup;
